import React from 'react';
import './Sports.css';

function Sports({

    vid1, vid2, vid3

}) {
    return (
        <div className="interests-container">
            <div className="interests-content-wrapper">
                <div className="sports-text-wrapper">
                    <h1>
                        Sports
                    </h1>
                    <h2>
                        I like to be active.
                    </h2>
                    <h3>
                        check out some fresh highlights
                    </h3>
                </div>

                <div className="sports-vid-wrapper">
                    <video src={vid1} className="highlight-1"/>
                    <video src={vid2} className="highlight-2"/>
                    <video src={vid3} className="highlight-3"/>
                </div>
            </div>
            
            

        </div>
    )
}

export default Sports;
